import React from 'react';

function Login() {
  return(
    <div class="container">
     <div class="row justify-content-center">
      <div class ="col-md-8">

    <form>
       <label>
         CODE:
         <input type="text" />
       </label>
       <label>
         PIN:
         <input type="text" />
       </label>
       <input type="submit" value="Submit" />

     </form>
       </div>
      </div>
     </div>
  );
}

export default Login;
